  private graphDataSubject = new BehaviorSubject<GraphData>({ nodes: [], links: [] });
  private currentPage = 1;
  private pageSize = 10;
  private totalItems = 0;
  
  graphData$ = this.graphDataSubject.asObservable();

  constructor() {
    this.processData(this.sampleData, 1);
  }

  private processData(data: AgentExecution[], page: number): void {
    const startIndex = (page - 1) * this.pageSize;
    const endIndex = startIndex + this.pageSize;
    const paginatedData = data.slice(startIndex, endIndex);
    
    // Add timestamp for proper ordering
    paginatedData.forEach(execution => {
      execution.timestamp = new Date(execution.run_on.replace('/', '-')).getTime();
    });

    // Sort by timestamp in ascending order (changed from descending)
    paginatedData.sort((a, b) => (a.timestamp ?? 0) - (b.timestamp ?? 0));

    const nodes: GraphNode[] = [];
    const links: GraphLink[] = [];
    const processedIds = new Set<string>();

    paginatedData.forEach((execution, index) => {
      if (!processedIds.has(execution.app_insight_operation_id)) {
        nodes.push({
          id: execution.app_insight_operation_id,
          label: execution.app_insight_operation_id,
          status: execution.run_status,
          data: execution,
          order: startIndex + index + 1
        });
        processedIds.add(execution.app_insight_operation_id);
      }

      if (index > 0) {
        links.push({
          source: paginatedData[index - 1].app_insight_operation_id,
          target: execution.app_insight_operation_id
        });
      }
    });

    this.graphDataSubject.next({ 
      nodes, 
      links,
      hasMore: endIndex < data.length,
      currentPage: page,
      totalPages: Math.ceil(data.length / this.pageSize)
    });
  }

  getDataByGroupId(groupId: string, page: number = 1): Observable<GraphData> {
    const filteredData = this.sampleData.filter(item => item.agent_group_id === groupId);
    this.currentPage = page;
    this.totalItems = filteredData.length;
    this.processData(filteredData, page);
    return this.graphData$;
  }

  loadMore(): void {
    if (this.currentPage * this.pageSize < this.totalItems) {
      this.currentPage++;
      this.getDataByGroupId('3D62EDA5-A2DD-4A23-98FF-AB1B758FDD9C', this.currentPage);
    }
  }

  hasMoreData(): boolean {
    return this.currentPage * this.pageSize < this.totalItems;
  }
